Bugün biyoloji olimpiyatına girişimin 1. Yıldönümü, bu sene beni daha güçlü kılan geçen yılki ezikliğim, yaz tatili çalışmalarım böyle başladı.

Daha çok Baştaydı küçük kız, hala öyle. Ama daha özgüvenli, daha mutlu ve başlarda campbell dilini hiç anlayamayan kız ekoloji evrim hariç tamamını bitirdi bugün.

En ufak çabamın farkına varan, destekleyen, olimpiyatı bilen ve öğreten Nuran Hocam; 
